import React from 'react'
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMoon } from '@fortawesome/free-solid-svg-icons';
//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {


  const mensaje = () =>{

    alert('Se ha intentado cambiar el estilo')
  }

  return (
    <nav>
      <div>
        <h2>DH ODONTO</h2>
      </div>
      <div className='nav_icons'>
      <Link className='nav_button' to={`/`}>Home</Link>
      <Link className='nav_button' to={`/contacto`}>Contact</Link>
      <Link className='nav_button' to={`/favs`}>Favs</Link>
      <FontAwesomeIcon  className='nav_button' icon={faMoon} onClick={mensaje}/>
      </div>
    </nav>
  )
}

export default Navbar
